import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About This Application</h1>
            <p>This application is built using React and demonstrates basic concepts such as routing, state management, and DOM manipulation.</p>
            <p>Developed by [Your Name].</p>
        </div>
    );
};

export default About;
